import React from 'react';
import {Table} from 'react-bootstrap';

function TransferList(transfers) {

  return (

    <Table striped bordered hover>
  <thead>
    <tr>
      <th>Id</th>
      <th>Amount</th>
      <th>approvals</th>
      <th>sent</th>
    </tr>
  </thead>
  <tbody>
    {transfers}
    console.log(transfers);

  </tbody>
</Table>
  );
}

export default TransferList;
